  "lockfile-version": 1,
  "manifest": {
    "version": 1,
    "install": {
      "_1password-cli": {
        "pkg-path": "_1password-cli"
      },
      "jq": {
        "pkg-path": "jq"
      },
      "mac-app-util": {
        "flake": "github:hraban/mac-app-util",
        "systems": [
          "x86_64-darwin",
          "aarch64-darwin"
        ]
      },
      "ripgrep": {
        "pkg-path": "ripgrep"
      },
      "tmux": {
        "pkg-path": "tmux"
      }
    },
    "vars": {
      "OP_ACCOUNT": "my.1password.com",
      "OP_SECRETS": "ANTROPIC_API_KEY OPENAI_API_KEY",
      "OP_SECRETS_ITEM": "Terminal",
      "TMUX_SESSION_NAME": "flox-session"
    },
    "hook": {
      "on-activate": "\nload_flox_op () {\n  echo \"ðŸ”‘ Loading secrets from 1Password\";\n  eval $(op signin);\n  __SECRETS=\"$(op item get $OP_SECRETS_ITEM --format json)\"\n  for secret in $OP_SECRETS; do\n    echo \"  ó°Š Exporting $secret secret\";\n    export $secret=$(echo $__SECRETS | jq -r \".fields[] | select(.label == \\\"$secret\\\") | .value\");\n  done\n  unset secret;\n  unset __SECRETS;\n}\n\nload_flox_macos () {\n  __ENV_NAME=$(echo $_FLOX_ACTIVE_ENVIRONMENTS | jq -r '.[0].pointer.name')\n  __ENV_APPS=\"$HOME/Applications/Flox ($__ENV_NAME) Apps\"\n  if [[ -d $__ENV_APPS ]]; then\n    rm -rf \"$__ENV_APPS\"\n  fi\n  if [ -d $FLOX_ENV/Applications ]; then \n    mac-app-util sync-trampolines \\\n      \"$FLOX_ENV/Applications\" \\\n      \"$__ENV_APPS\"\n  fi\n}\n\nload_flox_op\n\nif command -v mac-app-util 2>&1 >/dev/null; then\n  load_flox_macos\nfi\n"
    },
    "profile": {
      "common": "## Starting/Attaching to TMUX session\"\n##\n## 1. Check if the session already exists\n#tmux has-session -t $TMUX_SESSION_NAME 2>/dev/null\n##\n## 2. If the session doesn't exist, start a new one\n#if [ $? -ne 0 ]; then\n# echo \"Creating new session $TMUX_SESSION_NAME\"\n# tmux new-session -s $TMUX_SESSION_NAME -d\n#fi\n##\n## 3. If the session exists, reattach to it\n#if [ ! -n \"$NVIM_LISTEN_ADDRESS\" ] ; then\n#if [ \"$TERM_PROGRAM\" = tmux ]; then\n#  echo 'In tmux'\n#else\n#  echo 'Not in tmux'\n#fi\n##  echo \"Not inside neovim terminal\"\n##  if [ -n \"$TMUX\" ]; then\n##    tmux switch-client -t $TMUX_SESSION_NAME\n##  else\n##    tmux attach-session -t $TMUX_SESSION_NAME\n##  fi\n#fi\n"
    },
    "options": {
      "systems": [
        "aarch64-darwin",
        "aarch64-linux",
        "x86_64-darwin",
        "x86_64-linux"
      ],
      "allow": {
        "licenses": []
      },
      "semver": {}
    }
